func NewNdax(userConfig map[string]interface{}) *Ndax {
	p := &ndax{}
	p.Init(userConfig)
	return &Ndax{
		ndax:          p,
		Core:          p,
		exchangeTyped: NewExchangeTyped(&p.Exchange),
	}
}

